    {
      "lineNumber": 165871,
      "originalJapaneseLine": "今から受ける精神的苦痛を思い、",
      "translatedEnglishLine": "Thinking about the mental anguish about to be endured,"
    },
    {
      "lineNumber": 165872,
      "originalJapaneseLine": "ニミッツの背筋が冷える。",
      "translatedEnglishLine": "Nimitz's spine chills."
    },
    {
      "lineNumber": 165873,
      "originalJapaneseLine": "（あ、あ、あ……いや……やだ……",
      "translatedEnglishLine": "(Ah, ah, ah... no... I don't want this...)"
    },
    {
      "lineNumber": 165874,
      "originalJapaneseLine": "　もう、傷つけられるの……やだ……）",
      "translatedEnglishLine": "I don't want to be hurt anymore...)"
    },
    {
      "lineNumber": 165875,
      "originalJapaneseLine": "（お、お願い、なにも言わない、で……）",
      "translatedEnglishLine": "(P-please, don't say anything...)"
    },
    {
      "lineNumber": 165876,
      "originalJapaneseLine": "（ごめんなさい、ごめんなさい、ごめんなさい、",
      "translatedEnglishLine": "(I'm sorry, I'm sorry, I'm sorry,"
    },
    {
      "lineNumber": 165877,
      "originalJapaneseLine": "　勝手に部屋に入ったことは謝りますから……だから……）",
      "translatedEnglishLine": "I'll apologize for entering the room without permission... so please...)"
    },
    {
      "lineNumber": 165878,
      "originalJapaneseLine": "「ふむ……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 165879,
      "originalJapaneseLine": "「予想してなかったタイプの女の子だったな」",
      "translatedEnglishLine": "\"You're a type of girl I didn't expect.\""
    },
    {
      "lineNumber": 165880,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 165881,
      "originalJapaneseLine": "「だが、ごーかーーーく！",
      "translatedEnglishLine": "\"But, I passsss!"
    },
    {
      "lineNumber": 165882,
      "originalJapaneseLine": "　個性的な顔だが可愛いではないか！」",
      "translatedEnglishLine": "You have a unique face, but isn't it cute!\""
    },
    {
      "lineNumber": 165883,
      "originalJapaneseLine": "「……へ？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 165884,
      "originalJapaneseLine": "「なにを呆けているんだ？　変な奴だな」",
      "translatedEnglishLine": "\"What are you spacing out for? You're weird.\""
    },
    {
      "lineNumber": 165885,
      "originalJapaneseLine": "「うむ、結構好きなタイプの顔だ」",
      "translatedEnglishLine": "\"Hmm, you're quite my type of face.\""
    },
    {
      "lineNumber": 165886,
      "originalJapaneseLine": "「……す、き？」",
      "translatedEnglishLine": "\"...L-like?\""
    },
    {
      "lineNumber": 165887,
      "originalJapaneseLine": "（すき、って……",
      "translatedEnglishLine": "(Like... what does that word mean again?)"
    },
    {
      "lineNumber": 165888,
      "originalJapaneseLine": "　どういう意味の言葉だっけ？）",
      "translatedEnglishLine": "(What exactly does it mean?)"
    },
    {
      "lineNumber": 165889,
      "originalJapaneseLine": "（殺したい、だっけ？",
      "translatedEnglishLine": "(Does it mean I want to kill you?)"
    },
    {
      "lineNumber": 165890,
      "originalJapaneseLine": "　ムカつくだっけ？　ウザいだっけ？）",
      "translatedEnglishLine": "(Is it annoyed? Or annoying?)"
    },
    {
      "lineNumber": 165891,
      "originalJapaneseLine": "（え、ええ……？）",
      "translatedEnglishLine": "(Eh, eh...?)"
    },
    {
      "lineNumber": 165892,
      "originalJapaneseLine": "ニミッツは小さく何度も首を横に振る。",
      "translatedEnglishLine": "Nimitz shook her head slightly several times."
    },
    {
      "lineNumber": 165893,
      "originalJapaneseLine": "「あのあのあの、わた、私、部屋を間違えて……",
      "translatedEnglishLine": "\"Um, um, um, I, I mistook the room..."
    },
    {
      "lineNumber": 165894,
      "originalJapaneseLine": "　だ、だから、あの……ちが、わたし……」",
      "translatedEnglishLine": "S-so, um... no, I...\""
    },
    {
      "lineNumber": 165895,
      "originalJapaneseLine": "「なに意味分からんことをごにょごにょと」",
      "translatedEnglishLine": "\"What nonsense are you mumbling about?\""
    },
    {
      "lineNumber": 165896,
      "originalJapaneseLine": "「俺様の部屋に入った女の子は全員、",
      "translatedEnglishLine": "\"Any girl who enters my room,"
    },
    {
      "lineNumber": 165897,
      "originalJapaneseLine": "　俺に抱かれてもオーケですよって意味なのだ」",
      "translatedEnglishLine": "Means she's okay with being embraced by me.\""
    },
    {
      "lineNumber": 165898,
      "originalJapaneseLine": "「だから抱く。",
      "translatedEnglishLine": "\"So I will embrace you."
    },
    {
      "lineNumber": 165899,
      "originalJapaneseLine": "　これは総統閣下として当然のことなのだ」",
      "translatedEnglishLine": "This is, after all, the right thing to do as the supreme commander.\""
    },
    {
      "lineNumber": 165900,
      "originalJapaneseLine": "「がははは、というわけでいただきまーーす！」",
      "translatedEnglishLine": "\"Gahaha, so, I'll take you now!\""
    },
    {
      "lineNumber": 165901,
      "originalJapaneseLine": "「ぴえええっ！？」",
      "translatedEnglishLine": "\"Pieee!?!\""
    },
    {
      "lineNumber": 165902,
      "originalJapaneseLine": "「うりゃ」",
      "translatedEnglishLine": "\"Urya!\""
    },
    {
      "lineNumber": 165903,
      "originalJapaneseLine": "「んむううっ！？　んんんんーーーーッ！？」",
      "translatedEnglishLine": "\"Nmmm!?!? Nnnnn------!?\""
    },
    {
      "lineNumber": 165904,
      "originalJapaneseLine": "またランスに唇を奪われ、",
      "translatedEnglishLine": "Lance snatched her lips again,"
    },
    {
      "lineNumber": 165905,
      "originalJapaneseLine": "ニミッツは素っ頓狂な驚きの声を上げた。",
      "translatedEnglishLine": "Nimitz let out an absurdly surprised cry."
    },
    {
      "lineNumber": 165906,
      "originalJapaneseLine": "（ままま、また、この人、キス、キスを……！？）",
      "translatedEnglishLine": "(A-again, this person, a kiss, a kiss...!?)"
    },
    {
      "lineNumber": 165907,
      "originalJapaneseLine": "ランスの舌が小さな唇を割り開いて、",
      "translatedEnglishLine": "Lance's tongue parted her small lips,"
    },
    {
      "lineNumber": 165908,
      "originalJapaneseLine": "ニミッツの口内に入り込む。",
      "translatedEnglishLine": "And entered Nimitz's mouth."
    },
    {
      "lineNumber": 165909,
      "originalJapaneseLine": "（し、舌！？）",
      "translatedEnglishLine": "(T-tongue!?)"
    },
    {
      "lineNumber": 165910,
      "originalJapaneseLine": "舌はニミッツの舌と絡み合いながら、",
      "translatedEnglishLine": "His tongue tangled with Nimitz's,"
    },
    {
      "lineNumber": 165911,
      "originalJapaneseLine": "時に他の場所へ浮気し、歯をなぞっていく。",
      "translatedEnglishLine": "Sometimes straying elsewhere, tracing along her teeth."
    },
    {
      "lineNumber": 165912,
      "originalJapaneseLine": "（あ、あ、わたし、この人と……キス、してる……",
      "translatedEnglishLine": "(A-ah, I'm kissing this person..."
    },
    {
      "lineNumber": 165913,
      "originalJapaneseLine": "　舌、舌、舌がうねうねって中で……）",
      "translatedEnglishLine": "With tongues, tongues, tongues wriggling around inside...)"
    },
    {
      "lineNumber": 165914,
      "originalJapaneseLine": "（うあ、うあ、こ、これがキスなんだ……",
      "translatedEnglishLine": "(Wah, wah, th-this is a kiss...)"
    },
    {
      "lineNumber": 165915,
      "originalJapaneseLine": "　か……考えていたよりも……）",
      "translatedEnglishLine": "It's... more than I imagined...)"
    },
    {
      "lineNumber": 165916,
      "originalJapaneseLine": "（あれ？　気持ち良くない）",
      "translatedEnglishLine": "(Huh? This doesn't feel good.)"
    },
    {
      "lineNumber": 165917,
      "originalJapaneseLine": "（なにこれ、気持ち悪い……",
      "translatedEnglishLine": "(What is this, it's disgusting..."
    },
    {
      "lineNumber": 165918,
      "originalJapaneseLine": "　口の中でなまこが踊ってるみたい……）",
      "translatedEnglishLine": "It's like sea cucumbers are dancing in my mouth...)"
    },
    {
      "lineNumber": 165919,
      "originalJapaneseLine": "今までに何度考えたことがあるだろう。",
      "translatedEnglishLine": "How many times has she thought about this before?"
    },
    {
      "lineNumber": 165920,
      "originalJapaneseLine": "ニミッツが何度も妄想し夢に見た、",
      "translatedEnglishLine": "The first kiss that Nimitz had repeatedly fantasized and dreamed about"
    },
    {
      "lineNumber": 165921,
      "originalJapaneseLine": "初めてのキスは全く想像と違っていた。",
      "translatedEnglishLine": "Was completely different from what she imagined."
    },
    {
      "lineNumber": 165922,
      "originalJapaneseLine": "「っぷはー、うむうむ、いい感じだ。",
      "translatedEnglishLine": "\"Pff, hmm hmm, this feels good."
    },
    {
      "lineNumber": 165923,
      "originalJapaneseLine": "　がははははははははは」",
      "translatedEnglishLine": "\"Gahahahahahahaha!\""
    },
    {
      "lineNumber": 165924,
      "originalJapaneseLine": "（ななな、なにこの人……頭おかしいの……？",
      "translatedEnglishLine": "(W-w-what is this person... is he crazy...?)"
    },
    {
      "lineNumber": 165925,
      "originalJapaneseLine": "　わたしなんかを相手に……こんなこと……）",
      "translatedEnglishLine": "Doing something like this with someone like me...)"
    },
    {
      "lineNumber": 165926,
      "originalJapaneseLine": "「なんだ、その大きく見開いた目は、",
      "translatedEnglishLine": "\"What's with those wide-open eyes,"
    },
    {
      "lineNumber": 165927,
      "originalJapaneseLine": "　俺様の顔がそんな不思議か？」",
      "translatedEnglishLine": "Is my face that fascinating to you?\""
    },
    {
      "lineNumber": 165928,
      "originalJapaneseLine": "「あ、う、え……」",
      "translatedEnglishLine": "\"Ah, uh, eh...\""
    },
    {
      "lineNumber": 165929,
      "originalJapaneseLine": "ぷるぷると首を横に振るニミッツ。",
      "translatedEnglishLine": "Nimitz shook her head tremblingly."
    },
    {
      "lineNumber": 165930,
      "originalJapaneseLine": "「なら、もうちょい幸せそうな顔をしろ。",
      "translatedEnglishLine": "\"Then, make a happier-looking face."
    }
  ]
}

